import React from "react";

export const ProductChild = (
    props
) => {

    return <div className="ProductChild d-flex">
        <div className="row">
                <div className="col-4 card">
                    <h1>{props.name}</h1>
                    <span>{props.age}</span>
                    <img src={props.img} />
                    <button className="btn btn-primary">Show Detail</button>
                </div>
        </div>
    </div>
}
